INSERT INTO `tbl_productos` (`id_producto`, `cantidad_disponible`, `cantidad_vendidos`, `fecha_registro`, `producto_descripcion`, `producto_nombre`, `producto_precio`, `id_categoria`, `id_estado`, `id_usuario`) VALUES
(1, 6, 4, '2024-03-19 20:47:18.000000', 'Descubre el equilibrio perfecto entre comodidad y estilo con nuestra camiseta oversize negra para hombre. Con un diseño moderno y un ajuste holgado, esta prenda es ideal para quienes buscan un look casual y contemporáneo.', 'CAMISETA OVERZISE NEGRA HOMBRE', 35000, 6, 1, 4),
(9, 6, 1, '2024-03-19 21:59:05.000000', 'combina el estilo clásico y deportivo con un toque contemporáneo y elegante. Fabricada con materiales de alta calidad, esta chaqueta es perfecta para quienes buscan una prenda versátil que complemente cualquier look casual.', 'CHAQUETA BEISBOLERA BLANCA HOMBRE', 86990, 9, 1, 4),
(14, 25, 0, '2024-03-29 08:47:48.000000', 'Añade un toque de sofisticación y rebeldía a tu guardarropa con nuestra chaqueta de cuero negra para mujer. Esta prenda icónica combina estilo y durabilidad, convirtiéndose en un imprescindible para cualquier temporada.', 'CHAQUETA DE CUERO NEGRA MUJER', 75990, 8, 1, 4),
(29, 92, 4, '2024-03-31 14:57:18.000000', 'Mejora tu rendimiento y estilo con nuestra chaqueta deportiva bicolor, confeccionada en nylon de alta calidad. Esta prenda combina funcionalidad y diseño, perfecta para tus actividades al aire libre o entrenamientos en el gimnasio.', 'CHAQUETA DEPORTIVA AZUL HOMBRE', 89990, 9, 1, 11),
(45, 49, 1, '2024-03-31 16:40:16.000000', 'Empodérate con nuestra chaqueta de entrenamiento diseñada específicamente para mujeres activas. Confeccionada en un vibrante color morado. Tejido técnico de alta calidad que ofrece transpirabilidad, manteniéndote seca y cómoda durante tus entrenamientos.', 'CHAQUETA DEPORTIVA MORADA MUJER', 49990, 8, 1, 11),
(47, 16, 0, '2024-03-31 16:47:02.000000', 'Entra en cada golpe con confianza y comodidad con las Kaos Stroke 2.0, unas zapatillas con amortiguación amplificada en la entre-suela para proporcionar una sensación más suave en la pista.', 'TENIS DEPORTIVOS HOMBRE ROJO&NEGRO', 285000, 10, 1, 11),
(51, 50, 0, '2024-04-23 15:14:36.000000', 'Da un paso hacia la comodidad y el estilo con nuestros tenis deportivos para mujer en un encantador color rosa. Diseñados para ofrecer un rendimiento superior, estos tenis son perfectos para cualquier actividad deportiva o casual.', 'TENIS DEPORTIVOS MUJER ROSA', 184900, 11, 1, 11),
(52, 15, 0, '2024-05-16 19:47:16.000000', 'Lleva tu entrenamiento al siguiente nivel con nuestros pantalones deportivos para hombre en color negro. Diseñados para ofrecer confort y rendimiento, estos pantalones son perfectos para cualquier actividad física o para un estilo de vida activo.', 'PANTAALON DEPORTIVO NEGRO HOMBRE', 78550, 5, 1, 11),
(63, 26, 0, '2024-05-26 12:17:54.000000', 'Lleva tu rendimiento al siguiente nivel con nuestros pantalones deportivos negros para mujer. Diseñados para proporcionar comodidad y estilo, estos pantalones son la elección perfecta para cualquier actividad física o para un look casual y relajado.', 'PANTALON DEPORTIVO NEGRO MUJER', 69990, 4, 1, 11),
(64, 80, 0, '2024-05-30 07:56:29.000000', 'Eleva tu entrenamiento con nuestra camiseta deportiva para hombre en un dinámico color verde. Diseñada para ofrecer el máximo rendimiento y comodidad, esta camiseta es perfecta para cualquier tipo de actividad física.', 'CAMISETA DEPORTIVA VERDE HOMBRE', 69990, 6, 1, 11),
(65, 45, 0, '2024-05-30 07:59:57.000000', 'Ilumina tu rutina de ejercicios con nuestra camiseta deportiva amarilla para mujer. Diseñada para ofrecer comodidad y rendimiento, esta prenda es perfecta para cualquier actividad física, asegurando que te sientas fresca y con estilo.', 'CAMIISETA DEPORTIVA AMARILLA  MUJER', 78990, 7, 1, 11),
(66, 40, 0, '2024-05-30 08:22:33.000000', 'Logra un estilo relajado y moderno con nuestros jeans negros holgados para hombre. Diseñados para ofrecer comodidad y un look desenfadado, estos jeans son ideales para cualquier ocasión casual.', 'JEAN HOLGADO NEGRO HOMBRE', 99990, 5, 1, 4),
(67, 40, 0, '2024-05-30 08:24:44.000000', 'Añade un toque de comodidad y estilo retro a tu vestuario con nuestros jeans azules holgados para mujer. Perfectos para un look casual y relajado, estos jeans son una combinación ideal de moda y funcionalidad.', 'JEAN AZUL CAMPANA MUJER', 99990, 4, 1, 4),
(68, 12, 0, '2024-05-30 08:35:38.000000', 'Completa tu look con nuestra gorra negra para hombre, un accesorio esencial que combina funcionalidad y estilo. Diseñada para brindar comodidad y versatilidad, esta gorra será tu compañera perfecta para cualquier ocasión.', 'GORRA NEGRA HOMBRE', 29990, 1, 1, 4);

